import React, { PropTypes } from 'react';
import Report from '../../../../../components/Report/EnergySavingReport/EnergySavingReport.widget';

const propTypes = {
  params: PropTypes.shape({
    assetId: React.PropTypes.string.isRequired
  }),
};

const Page = (props) => {
  const assetId = props.params.assetId;

  return (
    <Report assetId={assetId} />
  );
};

Page.propTypes = propTypes;

export default Page;
